<?php

namespace Database\Seeders;

use App\Enum\ClubStatus;
use App\Enum\LeagueStatus;
use Illuminate\Database\Console\Seeds\WithoutModelEvents;
use Illuminate\Database\Seeder;

class ClubSeeder extends Seeder
{
    /**
     * Run the database seeds.
     */
    public function run(): void
    {
        $names = ['Club 1', 'Club 2', 'Club 3', 'Club 4', 'Club 5', 'Club 6', 'Club 7', 'Club 8', 'Club 9', 'Club 10'];

        foreach ($names as $name) {
            $league = \App\Models\Club::factory()->create(
                [
                    'name' => $name,
                    'league_id' => 1,
                    'status' => ClubStatus::Active,
                ]
            );

            $league->addMediaFromBase64('data:image/webp;base64,')
                ->toMediaCollection('logo');
        }
    }
}
